import "../App.css";
import React from "react";

class Termekek extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        error: null,
        isLoaded: false,
        autok: []
      };
    }
  
    componentDidMount() {
      fetch("http://localhost:5000/api/auto/autok")
        .then(res => res.json())
        .then(
          (result) => {
            this.setState({
              isLoaded: true,
              autok: result
            });
          },
          (error) => {
            this.setState({
              isLoaded: true,
              error
            });
          }
        )
    }
  
    render() {
      const { error, isLoaded, autok } = this.state;
      if (error) {
        return <div>Error: {error.message}</div>;
      } else if (!isLoaded) {
        return <div>Loading...</div>;
      } else {
        return (
          <ul>
            {autok.map(auto => (
              <li key={auto._id}>
                {auto.nev} {auto.elektromos} {auto.ar}
              </li>
            ))}
          </ul>
        );
      }
    }
  }
export default Termekek;
